import React from 'react';

import './MainPageStyle.css';
// import {C_Button} from '../core/Components';
import { MdAccountCircle,MdPerson, MdSearch, MdApps } from 'react-icons/md';
import { ImHome } from 'react-icons/im';


export class MainPage extends React.Component {
    constructor(props) {
        super(props);

    }

    render(){
        
        return(
            <div id="container">
                
                <div className="leftMenuBar blur">
                    <div className="option">
                        <ImHome />
                    </div>
                    <div className="option">
                        {/* <C_Button icon="MdGroupAdd"/> */}
                    </div>
                    {/* <div className="option">
                            <BsTools className="toolIcon"/>
                        </div>
                        <div className="option">
                            <MdInsertChart/>
                        </div> */}
                </div>
                <header className="header">
    
                    {/* <div className="containerSearch">
                        <input placeholder="Pesquisar " className="searchBtn" type="text" />
                        <MdSearch className="searchIcon"/>
                    </div> */}
    
                    <div><MdSearch color="white" fontSize="30px"/></div>
                </header>
    
                <body className="body">
                    
                </body>
    
              
            </div>
        );
    };
}
